import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ResourceTable = () => {
  const [resources, setResources] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [resourceID, setResourceID] = useState('');
  const [region, setRegion] = useState(''); // State for region
  const [resourceType, setResourceType] = useState(''); // State for type

  // Function to fetch resources based on filters
  const fetchFilteredResources = () => {
    setLoading(true);
    const apiUrl = `http://localhost:8080/api/resources?region=${region}&type=${resourceType}`; // Pass filters as query params
    axios.get(apiUrl)
      .then(response => {
        setResources(response.data);
        setLoading(false);
      })
      .catch(error => {
        setError('Failed to fetch resources');
        setLoading(false);
      });
  };

  // Function to fetch all resources
  const fetchAllResources = () => {
    setLoading(true);
    const apiUrl = 'http://localhost:8080/api/resources'; // No filters
    axios.get(apiUrl)
      .then(response => {
        setResources(response.data);
        setLoading(false);
      })
      .catch(error => {
        setError('Failed to fetch resources');
        setLoading(false);
      });
  };

  const handleIDChange = (event) => {
    setResourceID(event.target.value);
  };

  const handleRegionChange = (event) => {
    setRegion(event.target.value); // Update region on change
  };

  const handleTypeChange = (event) => {
    setResourceType(event.target.value); // Update type on change
  };

  const handleFetchByID = () => {
    if (resourceID) {
      fetchFilteredResources(); // Fetch filtered resources by ID
    } else {
      setError('Please enter a valid resource ID');
    }
  };

  const handleSearch = () => {
    fetchFilteredResources(); // Fetch resources based on the filters
  };

  // Fetch all resources on initial load
  useEffect(() => {
    fetchAllResources();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>{error}</div>;
  }

  return (
    <div>
      {/* Search inputs for region and type */}
      <div>
        <input
          type="text"
          value={region}
          onChange={handleRegionChange}
          placeholder="Enter Region"
        />
        <input
          type="text"
          value={resourceType}
          onChange={handleTypeChange}
          placeholder="Enter Resource Type (instance/disk)"
        />
        <button onClick={handleSearch}>Search</button>
      </div>

      {/* Table to display the resources */}
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Region</th>
            <th>Type</th>
            <th>Status</th>
            <th>IP</th>
            <th>Created Time</th>
          </tr>
        </thead>
        <tbody>
          {resources.map(resource => (
            <tr key={resource.name}>
              <td>{resource.name}</td>
              <td>{resource.zone}</td>
              <td>{resource.type}</td>
              <td>{resource.status || 'N/A'}</td>
              <td>{resource.ipAddresses && resource.ipAddresses.length > 0 ? resource.ipAddresses.join(', ') : 'N/A'}</td>
              <td>{resource.creationTimestamp || 'N/A'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ResourceTable;
